        this.setState({
            value:e.target.value
        })
        console.log(this.state.inpValu)
    }

    render() { 
        return ( 
         <Editor value={this.state.value} onChange={this.handelChange.bind(this)} />
        );
        
    }
  componentDidMount(){}  
}
 
